            var verticals: [[Field.Definition]] = []
            var horizontal: [[Field.Definition]] = []

            let doc: Document = try SwiftSoup.parse(s)

            let rows1 = try doc.select("#nonogram_table").first()?.select("td.nmtt").first()?.select("tr")
            if let rows = rows1 {
                for row in rows {
                    let tds = try row.select("td")
                    for (i, td) in tds.enumerated() {
                        if i == verticals.count {
                            verticals.append([])
                        }
                        if let div = (try td.select("div").first()), let n = Int(try div.text()) {
                            var style = try td.attr("style")
                            style = style.replacingOccurrences(of: "background-color: rgb(", with: "")
                            style = style.replacingOccurrences(of: ");", with: "")
                            style = style.replacingOccurrences(of: ",", with: "")
                            verticals[i].append(Field.Definition(
                                color: Field.Color(rgb: style),
                                n: n
                            ))
                        }
                    }
                }
            }

            let rows2 = try doc.select("#nonogram_table").first()?.select("td.nmtl").first()?.select("tr")
            if let rows = rows2 {
                for row in rows {
                    let tds = try row.select("td")
                    var line = [Field.Definition]()
                    for td in tds {
                        if let div = (try td.select("div").first()), let n = Int(try div.text()) {
                            var style = try td.attr("style")
                            style = style.replacingOccurrences(of: "background-color: rgb(", with: "")
                            style = style.replacingOccurrences(of: ");", with: "")
                            style = style.replacingOccurrences(of: ",", with: "")
                            line.append(Field.Definition(
                                color: Field.Color(rgb: style),
                                n: n
                            ))
                        }
                    }
                    horizontal.append(line)
                }
            }

            let resolvingViewController = ResolvingViewController(
                horizintals: horizontal,
                verticals: verticals
            )
            addChild(resolvingViewController)
            view.addSubview(resolvingViewController.view)
            resolvingViewController.didMove(toParent: self)

            NSLayoutConstraint.activate([
                resolvingViewController.view.topAnchor.constraint(equalTo: view.topAnchor),
                resolvingViewController.view.bottomAnchor.constraint(equalTo: view.bottomAnchor),
                resolvingViewController.view.leadingAnchor.constraint(equalTo: view.leadingAnchor),
                resolvingViewController.view.trailingAnchor.constraint(equalTo: view.trailingAnchor),
            ])
        } catch Exception.Error(let type, let message) {
            print(message)
        } catch {
